using System;\nusing System.Text.RegularExpressions;\nusing System.Collections.Generic;\n\nclass Program\n{\n    static void Main()\n    {\n        string input = "{Token1}asdasasd{Token2}asd asdacscadase dfb db {Token3}";\n\n        // Define the regular expression pattern to capture text inside curly braces\n        string pattern = @"\{([^}]+)\}";\n\n        // Create a list to store the matches\n        List<string> tokens = new List<string>();\n\n        // Use Regex.Matches to find all matches in the input string\n        MatchCollection matches = Regex.Matches(input, pattern);\n\n        foreach (Match match in matches)\n        {\n            // Add the captured group (without braces) to the tokens list\n            tokens.Add(match.Groups[1].Value);\n        }\n\n        // Print the tokens\n        foreach (string token in tokens)\n        {\n            Console.WriteLine(token);\n        }\n    }\n}